import './App.css';
import Footer from './components/footer';
import Navbar from './components/navbar';

function App() {
  return (
    <div className="App">
      <Navbar />      

      <main>
      <h1>Welcome to my Online Store!</h1>
      </main>

      <Footer />
    </div>
  );
}

export default App;
